window.bookSummaryJSON = "<p><b>Alien mysteries. Parental responsibilities. The scout ship Kangaroo has jumped into trouble.</b></p> <p>Nora Devi intended to leave her old life behind. But when a quick detour to acquire the funds for a new identity goes awry, she finds herself plunged ever deeper into the troubles she hoped to avoid.</p> <p>The Human Sector is a stash of fuel cells just waiting for a spark to explode. The Great Game of politics and power has shifted from the inner realm to the border. Captain Liam Kimani of the battlecruiser <i>RC Genghis Khan</i> is the man in position to suppress the explosion...or ride the wave of it.</p> <p>It's been half a millennium since the Stranding. Is the power of the royals still worth supporting, or is it time to risk everything for the chance to rejoin the rest of humanity?</p>"; 
